import styled from 'styled-components';

export const Background = styled.header`
background-color:#d3d3d3;
border-bottom: 1px solid #b3b1b1;
`;

export const body = styled.body`
font-family: 'Open Sans Condensed', sans-serif;
background: white;












`;
